import React from "react";
import twbb from "../images/there-will-be-blood.jpg"
import { useNavigate } from "react-router-dom";

export default function Card({ props }) {
    const navigate = useNavigate();

    const navigateToMovie = () => {
        // üëáÔ∏è navigate to /contacts
        navigate('/there-will-be-blood');
    };

    console.log(props)
    const imgsource = "https://image.tmdb.org/t/p/original" + props.posterPath
    console.log(typeof (imgsource))
    console.log(imgsource)
    if (typeof props !== "undefined") {
        return (
            <div className="card" onClick={navigateToMovie}>
                <img src={imgsource} alt="there will be blood" className="poster" />
                <div className="movie--title">{props.title}</div>
                <div className="movie--director">
                    {props.genre}
                </div>
            </div>

        );
    }
    else {
        return (
            <div className="card" onClick={navigateToMovie}>
                {imgsource && <img src={twbb} alt="there will be blood" className="poster" />}
                <div className="movie--title">{props.title}</div>
                <div className="movie--director">
                    {props.genre}
                </div>
            </div>
        );
    }

}
